import { Toast } from "antd-mobile";
import React, { useEffect, useState } from "react";
import { saleBankCard, saleBankCardStart, saleBankCardStop } from "../request"
import "../style.scss"
const status:any = {
 'WORKING': '停止代售',
 'IDLE': '开始代售'
}
const OnSale = (props: any) => {
 const [data, setData] = useState<any>([])
 const { banks } = props;

 useEffect(() => {
  saleBankCardHandle()
 }, [])

 const saleBankCardHandle = () => {
  Toast.loading("加载中")
  saleBankCard().then(data => {
   Toast.hide()
   debugger
   setData(data)
  })
 }
 return (
  <>
   <ul className="agent-sale">
    {data && data.map((item: any) => {
     return (
      <li className="item">
       <div className="item-bank">
        <span className="agent-sale-icon">中</span>
        <p className="agent-sale-info">
         <span>中国银行:{data.cardNo}</span>
         <span>持卡人:{data.owner}</span>
        </p>
       </div>
       <div className="item-info">
        <p className="order-i">
         <span className="special">已接单笔数:{data.orderCount}</span>
        </p>
        <span className="on-money">{status[data.status]}</span>
       </div>
      </li>
     )
    })}
   </ul>
  </>
 )
}
export default OnSale;
